import React, { Component } from 'react'
import TodoForm from '../todo-form/TodoForm';

export default class TodoList extends Component {

    constructor(props){
        super(props)
        this.state = {
            todoList: []
        }
    }

    render() {
        return (
            <div>
                <TodoForm/>
            </div>
        )
    }
}
